    def ReadCOMS(self):
        result = []
        if sys.platform.startswith('win'):
            ports = ['COM%s' % (i + 1) for i in range(256)]
        for port in ports:
            try:
                s = serial.Serial(port)
                s.close()
                result.append(port)
            except (OSError, serial.SerialException):
                pass
        return result   

    def getCOM(self):
        port = self.COM_LIST.currentText()
        baudrate = self.BAUDRATE_LIST.currentText()
        self.ser = serial.Serial(port , baudrate , timeout=5)
        self.IMEI_VALUE = self.readIMEI()
        print(self.IMEI_VALUE)
        self.IMEI_LABEL.setText(str(self.IMEI_VALUE))

    
    def connectCOM(self):
        port = self.COM_LIST.currentText()
        baudrate = self.BAUDRATE_LIST.currentText()
        self.ser = serial.Serial(port , baudrate , timeout=5)
        IMEI = print("ICC: " + self.readICC())
        return IMEI

    def readICC(self):
        cmd="AT+QCCID\r"
        self.ser.write(cmd.encode())
        time.sleep(1)
        msg=self.ser.read(64)
        msg = str(msg)
        m = msg.rsplit("\\r\\n")
        n = m[1].rsplit(": ")
        return(n[1])

    def readIMEI(self):
        cmd="AT+CGSN\r"
        self.ser.write(cmd.encode())
        time.sleep(0.5)
        msg=self.ser.read(64)
        msg = str(msg)
        #m = msg.rsplit("QCCID: ")
        m = msg.rsplit("\\r\\n")
        return m[1]

